Tracker Rates explained 
All Base Rate Trackers are linked to Bank of England Base Rate; 
As the rate is linked to a variable rate, your monthly repayments may increase as well as decrease; 
This is the only product type available for “Offset” mortgages.

Fixed Rates explained 
A fixed rate provides an interest rate that remains the same during the fixed period of the loan. After the fixed period of your loan our fixed rates revert to Bank of England 
Base Rate plus a margin; 
This gives you the peace of mind of knowing that your monthly repayment will stay the same for the period during which the rate is fixed, as long as payments are made 
for the correct amount and on time, allowing you to plan accordingly; 
An Early Repayment Charge may apply in certain circumstances.
